  selector: 'app-create-new-event',
  templateUrl: './create-new-event.component.html',
  styleUrls: ['./create-new-event.component.css']
})
export class CreateNewEventComponent {
  @Input() eventDto!:EventDto;

  dateTime = new Date();

}
